import { ListGroup } from 'react-bootstrap';
import { FaPhone } from 'react-icons/fa';

const ContactDetail = () => {
    return (
        <ListGroup>
            <ListGroup.Item>
                <FaPhone /> 
                <br/>
                <span>+234 902 383 0868</span>
            </ListGroup.Item>
            
        </ListGroup>
    )
}

export default ContactDetail
